import React from 'react';
import { motion } from 'framer-motion';

const Image = ({ setSelectedImg }) => {
    const photos = [{
        photo: './Photos/eagle.jpg',
        text:"Penguin + Eagle"
    },
        {
            photo: './Photos/stuffedanimal.jpg',
            text:"Porcupine"
        },
        {
            photo: './Photos/koala.jpg',
            text:"koala"
        }
    ]
    return (
        <div className="img-grid">
            {photos && photos.map(doc => (
                <motion.div className="img-wrap" key={photos.text}
                            layout
                            whileHover={{ opacity: 1 }}s
                            onClick={() => setSelectedImg(photos.photo)}
                >
                    <motion.img src={require( `${ photos.photo }` ) }  alt="uploaded pic"
                                initial={{ opacity: 0 }}
                                animate={{ opacity: 1 }}
                                transition={{ delay: 1 }}
                    />
                </motion.div>
            ))}
        </div>
    )
}

export default Image;
